import React from 'react';
import PieChart from 'react-minimal-pie-chart';
import './CycleGraph.css';
import Loader from "../reusableComponents/Loader";


let terminated=0;
let passed=0;
let failed=0;
let timouted=0;


class CycleGraph extends React.Component {
    render() {
        let view=<Loader/>

        if (this.props.data.length>0){

            for(let i=0;i<this.props.data.length;i++){
                terminated+= this.props.data[i].Ex_Terminated;
                passed+=this.props.data[i].Ex_Passed;
                failed+=this.props.data[i].Ex_Failed;
                timouted+=this.props.data[i].Ex_TimeOut;
            }

            view=<div className="wrapper-chart">
                <div className="chart-sec">
                <PieChart data={[
                    {
                        title: 'Terminated',
                        value: parseInt(terminated),
                        color: '#ffe286'
                    },
                    {
                        title: 'Passed',
                        value: Math.round(parseInt(passed)),
                        color: '#45c176'
                    },
                    {
                        title: 'Failed',
                        value: parseInt(failed),
                        color: '#b02d2c',

                    },
                    {
                        title: 'Timeout',
                        value: parseInt(timouted),
                        color: '#55b8cc',
                    }
                ]}

                          lineWidth={30}
                          paddingAngle={-1}
                          lengthAngle={-360}


                          label={({ data, dataIndex }) =>
                              (Math.round(data[dataIndex].percentage)!=0)? `${Math.round(data[dataIndex].percentage)} %`:
                                  ''

                          }
                          labelStyle={{
                              fontSize: '8px',
                              fontFamily: 'sans-serif',
                              fontColor: '#fff'}}
                          labelPosition={60}
                          animate


                />
                </div>
                <div className="chart-titles">
                    <div className="titleChart1"><span className="dot yellow"/>Terminated</div>
                    <div className="titleChart2"><span className="dot green"/>Passed</div>
                    <div className="titleChart3"><span className="dot red"/>Failed</div>
                    <div className="titleChart4"><span className="dot blue"/>Timeout</div>
                </div>

            </div>
        }

        return (
            <div >
                {view}
            </div>
        );
    }
}

export default CycleGraph;
